import React, { useState, useEffect } from 'react';
import './styles.css';


function TeamWrap() {

    const [data, setData] = useState(null)

    useEffect(() => {
        fetch("/new-team")
          .then((res) => res.json())
          .then((data) => setData(data))
      }, []);


  return (
    <div className="select-wrapper">
        {data ? <>
            <p>{data[1].name}</p> 
        </>
        : <h3>No Teams Found</h3>}
    </div>
  );
}

export default TeamWrap;
